  return(
    <h1>
    {"This is the Test Page"}
    </h1>
  )
}

function App() {
  return (
    <div >
      <Route path="/test" component={TestPage}/>
      <Route  path="/" component={HomePage}/>
    </div>
  );
}

export default App;
